import React, { Component } from 'react';

export class Read extends Component {

    render(){
        return (
            <div>
                <table>
                    <thead>
                        <td>
                            {this.state.name}
                        </td>
                    </thead>
                </table>
            </div>
        )
    }
}

export default Read;
